要计算 \(58_9 - 18_9\) 并用 \(9\) 进制表示答案，我们首先将这些数字从 \(9\) 进制转换为 \(10\) 进制，执行减法，然后将结果转换回 \(9\) 进制。

首先，我们将 \(58_9\) 转换为 \(10\) 进制：
\[
58_9 = 5 \cdot 9^1 + 8 \cdot 9^0 = 5 \cdot 9 + 8 \cdot 1 = 45 + 8 = 53_{10}
\]

接下来，我们将 \(18_9\) 转换为 \(10\) 进制：
\[
18_9 = 1 \cdot 9^1 + 8 \cdot 9^0 = 1 \cdot 9 + 8 \cdot 1 = 9 + 8 = 17_{10}
\]

现在，我们在 \(10\) 进制中执行减法：
\[
53_{10} - 17_{10} = 36_{10}
 \]

最后，我们将 \(36_{10}\) 转换回 \(9\) 进制。为此，我们找到 \(36\) 除以 \(9\) 的商和余数：
\[
36 \div 9 = 4 \quad \text{余数} \quad 0
\]
因此，\(36_{10} = 40_9\)。

因此，答案是 \(\boxed{40_9}\)。　　\end{document}　　
